import logo from './logo.svg';
import './App.css';

function selectData() {
    axios.post('/testData' , ["가" , "나" , "다"])
    .then(function (res){
        console.log(res)
    });
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
            <button onClick = {() => selectData()}>조회</button>
        </div>
      </header>
    </div>
  );
}

export default App;
